contracts/Gym_Contact.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;

contract gym {
    struct Class{
        string name;
        uint value;
    }

    //Eventos:
    event ClassCreated (
        string name,
        uint value
    );

    //Inmutable;
    address immutable public ADMIN;

    constructor() {
        ADMIN = msg.sender;
    }

    //Alumnos:
    mapping(address => uint) public users;

    //Funciones del admin: 
    function createClass(string memory _name, uint _value) public {
        require(ADMIN == msg.sender, "Solo el Administrador del Gym puede crear clases");
        emit ClassCreated(_name, _value); //podria agregar un id para cada clase
    }
}

